import React from 'react';
import ReactDOM from 'react-dom';
import './header.css'

const Head = ()=>{
  return (
    <div className='header'>
      <div className="logo"></div>
      <div className="top-menu">
        <nav className="nav">
          <a href="">Persons</a>
          <a href="">Starships</a>
          <a href="">Planets</a>
        </nav>
      </div>


    </div>
  )
}

export default Head
